var tipuesearch = {"pages": [{'title': 'About', 'text': '國立虎尾科技大學機械設計工程系 \n National Formosa University \n Department of Mechanical Design Engineering \n cad2024 電腦輔助設計與實習 \n 課程教材: \n Intro_to_Mechatronics.pdf  ( Source ) \n Programming with Python for Engineers \n NX Tutorial \n cd2023_pj3ag4_zmq_football_4.7.7z \n cd2024_2b_g6_steel_ball_platform_nxopen_copsim.7z \n Teams 線上教學: \n 以 "學號@nfu.edu.tw" 登入  https://login.microsoftonline.com/  Office 365 \n Teams 團隊代碼:  7pg9z7u \n 個人倉儲: https://github.com/mdecad2024/hw-zhe41223118 \n 個人網站: https://mdecad2024.github.io/hw-zhe41223118 \n 其他資訊 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Attendance', 'text': '出席 (10%) - 自行舉證評分 \n 自行利用 Github commits 提交記錄評分。 \n \n 每周課程總結及課前上傳更新內容在此頁面目錄下 \n', 'tags': '', 'url': 'Attendance.html'}, {'title': 'w1', 'text': '本週提到因為replit的免費使用已不能再無限制使用，所以能使用的還有github提供的 Codespaces 近端及遠端，而本週課程結束前，有提到需將本週影片：利用 Codespaces 維護個人的作業網站，新增字幕並上傳至個人網站的HW1頁面。 \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2', 'text': '本週一開始複習使用 Codespaces來維護個人網站，後面提到如何架設近端來維護，最後提到本週之後將不會在提到如何維護網站的相關事項，經過兩週複習各學員應已大致了解或復盤維護網站內容。 \n 在 本周第一支影片 中，開頭提到本課程使用作業倉儲，如何使用github中的Codespaces來維護網頁，在使用Codespaces可能在操作上造成的程式遺失，都能回到github作業倉儲code下方找到原先程式。 \n \n 使用github提供的Codespaces服務開啟的作業網站，除非自己去公開網址，不然沒有人會知道自己的動態網站(靜態同理 )，此外影片也有提到網頁如何編寫的大致方式。 \n 能使用課程提供的 可攜程式 ，開啟終端機後，選擇data目錄中的sharexa目錄裡的同名應用程式啟動，就能擷取螢幕，後面也有提到如何上傳至網頁。 \n \n 最後提到： \n git add . \n git commit "填入" \n git pull \n 提交功能(git status-確認提交狀態) \n', 'tags': '', 'url': 'w2.html'}, {'title': '近端', 'text': '在 本周第二支教學影片 中： \n 近端維護共有三種方式， HTTPS  SSH GitHub CLI，而SSH需綁定登錄檔較為麻煩，所以本支教學影片使用HTTPS，如果想使用SSH做近端維護，可以觀看先前 這個網站 教學步驟。 \n 首先： \n 1. 確認要克隆的作業倉儲，複製HTTPS倉儲網址 \n 2. 至命令指令，移動到tmp，輸入git clone 網址 (如果後方沒有輸入其他將默認克隆檔名稱) \n 3. 至倉儲，點擊右上方頭像至設定，滑至最下方左側Developer Settings(開發者設定)，Personal access tokens下的tokens (classic)，此設定彈性少，但較為簡單，之後右上點開選擇New personal access token (classic) \n 4. repo需勾選，之後就能新建tokens，複製tokens，需將其放置克隆好的 倉儲目錄的git.下的config 裡 \n 5. 將tokens放置個人倉儲連結的 //後+@ \n 做完以上步驟就能在近端上維護個人網站。 \n 最後網站內容上傳，會因為還未綁定身分而無法上傳，就依序的輸入回答出現問題，之後就能正常地在近端維護網站了。 \n', 'tags': '', 'url': '近端.html'}, {'title': 'w3', 'text': '1. cmsimde \n adhoc https \n openssl https \n 2. start hybrid \n 3. solvesapce \n NX2312 \n \n 課堂利用coppeliaSim導入solvespace圖檔(Mech) \n \n 課後作業 coppeliaSim導入 ： \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'set-NX', 'text': '課程提供為NX2312，為9GB的可移動式小繪圖檔案。 \n 需配合另一個 可攜程式 檔，將 NX下載檔 放入可攜程式的 date 下，並修改名稱為NX。 \n 環境準備好後，操作如下： \n \n 註：如果以上步驟皆完成卻無法開啟，請將ipv6 關閉重啟後再輸入影片中指令。 \n', 'tags': '', 'url': 'set-NX.html'}, {'title': 'w6', 'text': 'https://mdecad2024.github.io/hw-zhe41223118/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223118/41223118_part1.stl \n \n \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n \n solvespace： part1.slvs \n \n 1. 確認所在位置在要上傳檔案的資料夾(範例在 C:tmp ) \n 2. sftp @前面為自己的學號(例圖就為 41223118 )，密碼需至學校main2000查詢 \n 3. cd ..  為退出一個目錄  pwd  為確認所在目錄，最終需移動到自己學號下的 public_html  \n (例圍為： /C/Users/41223118/public_html ) \n 4. 最後輸入 put 上傳檔案全名包括檔名(範例為： 41223118_part3.stl ) \n', 'tags': '', 'url': 'w6.html'}, {'title': 'other-1', 'text': 'https://mdecad2024.github.io/hw-zhe41223118/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223118/41223118_part2.stl \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n solvespace： part2.slvs \n', 'tags': '', 'url': 'other-1.html'}, {'title': 'other-2', 'text': 'https://mdecad2024.github.io/hw-zhe41223118/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223118/41223118_part3.stl \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n solvespace： part3.slvs \n', 'tags': '', 'url': 'other-2.html'}, {'title': 'multiple stl', 'text': '       新增第三個 canvas  \n Model Color:  Back Color1:  Back Color2:    Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n embed_stl_page.txt \n embed_multiple_stl_page.txt \n solvespace： \n 41223118_part1.stl \n 41223118_part2.stl \n 41223118_part3.stl \n', 'tags': '', 'url': 'multiple stl.html'}, {'title': 'w7', 'text': '關於 這裡 前32頁，繪製過程影片放置  practise  頁面、 .stl  上傳瀏覽至  web browsing  頁面 \n 使用solvespace繪圖 檔案下載 及上傳後 頁面連結 、 NX下載零件 ： \n (solvespace / 網頁瀏覽 / NX) \n part1 \xa0 /\xa0\xa0 page1 \xa0 /\xa0  nxpart1 \n part2 \xa0 /\xa0\xa0 page2 \xa0\xa0 /\xa0  nxpart2 \n part3 \xa0 /\xa0\xa0 page3 \xa0\xa0 /\xa0  nxpart3 \n part4 \xa0 /\xa0\xa0 page4 \xa0\xa0 /\xa0  nxpart4 \n part5-改 \xa0 /\xa0\xa0 page5-改 \xa0\xa0/\xa0  nxpart5改 \n part6 \xa0 /\xa0\xa0 page6 \xa0\xa0 /\xa0\xa0 \xa0  nxpart6 \n part7 \xa0 /\xa0\xa0 page7 \xa0\xa0 /\xa0  nxpart7 \n part8 \xa0 /\xa0\xa0 page8 \xa0\xa0 /\xa0\xa0nxpart8 \n part9 \xa0 /\xa0\xa0 page9 \xa0\xa0/\xa0  nxpart9 \n part10 \xa0 /\xa0\xa0 page10 \xa0\xa0 /\xa0\xa0nxpart10 \n part11 \xa0 /\xa0\xa0 page11 \xa0\xa0/\xa0  nxpart11 \n part12 \xa0 /\xa0\xa0 page12 \xa0\xa0 /\xa0  nxpart12 \n part13 \xa0 /\xa0\xa0 page13 \xa0\xa0/\xa0  nxpart13 \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'solvespace', 'text': 'w3開始以 solvespace 練習零件 影片 繪製過程放置此： \n point 零件瀏覽 \n point 零件下載 \n part3 \n \n part4 \n \n part5 \n \n part6 \n \n part7 \n \n part8 \n \n part9 \n \n part10 \n \n part11 \n \n part12 \n \n part13 \n \n ----------------------------------------------------------------------------------------------------------- \n part1 \n \n part2 \n \n', 'tags': '', 'url': 'solvespace.html'}, {'title': 'NX', 'text': 'w3開始以  NX \xa0 練習零件 影片 繪製過程放置此： \n \n 瀏覽 solvespace page \n 瀏覽\xa0web\xa0page \n ------------------------------------------------------------------------------------------------------------ \n part1 \n \n part2 \n \n part3 \n \n part4 \n \n part5 \n \n part6 \n \n part7 \n part8 \n part9 \n part10 \n part11 \n part12 \n part13 \n', 'tags': '', 'url': 'NX.html'}, {'title': 'web browsing', 'text': '遠端連接 學校主機上傳 .stl 檔流程： \n \n 以下是上傳的練習零件( .stl )： \n \n  引入JSC3D庫  \n \n  增加13個畫布元素                            \n Model Color:  Back Color1:  Back Color2:    Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n', 'tags': '', 'url': 'web browsing.html'}, {'title': 'w9', 'text': '\xa0本週需至teams填寫其中期望成績 \n 下週檢查個人網頁進度 \n', 'tags': '', 'url': 'w9.html'}, {'title': '課前預習', 'text': '以如下圖尺寸依序繪製出三樣零件後，從solvespace 到 coppeliaSim的組合件練習，如下的過程影片。 \n \n \n', 'tags': '', 'url': '課前預習.html'}, {'title': 'Ten-week', 'text': '(這裡放了在w10課堂小考內容，只有放置了在 課程時間內所完成進度 ， 完整內容及影片 皆放置在題目要求的 HW1_Exam" 頁面之後, 加上一個第三階的頁面, 標題為 "w10" 頁面裡。) \n 點擊這裡前往觀看 \n \n https://mdecad2024.github.io/hw-zhe41223118/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223118/41223118_exam1.stl \n \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n (註：本周重點為 課程小考 ，以solvespace和NX分別繪製所要求題目，並填寫完teams表單，題目分三題，第二題NX部分將再w11講解) \n', 'tags': '', 'url': 'Ten-week.html'}, {'title': 'solv_part5', 'text': '\n 原本尺寸頂部等高，但圖示中中心方孔與外側高度不同，以下是修改後草圖： \n \n 尺寸圖： \n \n 檔案下載及網頁檢視請至 Picture file \n', 'tags': '', 'url': 'solv_part5.html'}, {'title': 'w11_hw', 'text': '本周需至 這裡 的課程頁面，將 flipper_nx2312.7z 檔案下載，分別以NX、solvespace 繪製其中的： \n Plongeur Batteur_sldprt.prt \n Piece composite_sldprt.prt \n Piece métalique gauche_sldprt.prt \n Plastique Flipper_sldprt.prt \n Support Bobine_sldprt.prt \n Platine Batteur_sldprt.prt \n Flipper_sldprt.prt \n 繪製檔案後轉為stl檔至 coppeliaSim組合 及試者 模擬使其轉動 。 \n 內容過程為三人一組製作，其中我的部分是將其中： \n Flipper_sldprt \n Plastique Flipper_sldprt \n Support Bobine_sldprt \n Plongeur Batteur_sldprt \n Piece composite_sldprt\xa0 \n 等五個圖形較為簡單的以 solvespace 繪製。(此為 STL ，需 SLVS、PRT 或觀看繪製 過程影片 請 點擊這 ) \n 剩餘的Platine Batteur_sldprt.prt 零件及Piece métalique gauche_sldprt.prt 零件分別由 \n 41223134\xa0   41223136 \n 兩位成員完成 \n --------------------------------------------------------------------------------------------------------------- \n 以下為課後繪製結果： \n \n  增加5個畫布元素            \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n', 'tags': '', 'url': 'w11_hw.html'}, {'title': 'solv_part13', 'text': 'part13繪製影片中在延伸出的轉角處，角度輸入錯誤，以下是更正後草圖擷取畫面。 \n (檔案及網頁瀏覽都已及時更新) \n \n \n', 'tags': '', 'url': 'solv_part13.html'}, {'title': 'w12_ch', 'text': '本週抽查w7、w10、w11_hw 頁面完成進度 \n 介紹solvespace功能及組合零件的技巧 \n 下周需完成 組合零件 及嘗試 以solvespace組立 零件， \n 分配繪製的 solvespace零件已繪製完成，觀看請 點擊這裡 \n ---------------------------------------------------------------------------------------------------------------- \n \n \n', 'tags': '', 'url': 'w12_ch.html'}, {'title': 'w13', 'text': '本週會提到的使用NX組配及coppeliaSim 嘗試使零件轉動，襙作過程影片如下： \n NX： 組合圖下載 \n coppeliaSim： 模擬檔下載 \n \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '', 'tags': '', 'url': 'w14.html'}, {'title': 'HW1', 'text': '利用 Codespaces 維護作業網站 ； \n w1 作業內容，將 這個 影片原檔加上字幕，如下 \n \n \n Homework 1 (10%): \n 利用 Solvespace 與 NX2312 建立  Parts  頁面中的零件 \n 其他 零件模擬練習 \n \n 利用 Solvespace 繪製列表中零件的操作過程與說明影片如下: \n \n 註：此零件事後發現最後斜角長出部分過短，需將原本長度7mm改為以上之值，以8-12mm為最佳，過長或過短會導致零件有缺角或凸出。 \n 所完成的零件檔案下載: 41223118_part1.slvs \n \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業一之二 \n \n \n \xa0後續發現有規定尺寸檔案圖，將原檔案尺寸修改後重新更新了完成檔案及結果圖 \n \n 所完成的零件檔案下載： 41223118_part2-改.slvs \n \n 利用 NX2312 繪製列表中零件的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業一之三 \n 所完成的零件檔案下載 \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業一之四 \n 所完成的零件檔案下載 \n ...... \n HW1 執行心得: \n ...... \n HW1 自評分數: \n 完成上述流程後, 請將 HW1 自評分數輸入 cad2024 自評表單中. \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'HW1_Exam', 'text': '從 零件模擬練習 中選出零件, 隨堂進行考試. \n 零件考試題目以 Solvespace 繪圖操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的零件檔案下載 \n 零件考試題目以 NX2312 繪圖操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的零件檔案下載 \n', 'tags': '', 'url': 'HW1_Exam.html'}, {'title': 'w10', 'text': '題目一： \n 下載檔案 \n \n \n 題目二： \n 下載檔案 \n \n \n 題目三： \n 下載檔案 \n \n 下圖是而外在開一solvespace去繪製草圖一，為求出如圖，底40所突出的未知長度。 \n \xa0 \xa0 \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n https://mdecad2024.github.io/hw-zhe41223118/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223118/41223118_exam2.stl \n', 'tags': '', 'url': 'w10.html'}, {'title': 'HW2', 'text': 'Homework 2 (10%): \n 利用 Solvespace 與 NX 建立  Balance on Wheels  組立件 \n \n 利用 Solvespace 繪製  Balance on Wheels  組立件的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業二之一 \n 所完成的零組件檔案下載 \n 利用 NX2312 繪製  Balance on Wheels  組立件的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業二之二 \n 所完成的零件檔案下載 \n HW2 執行心得: \n ...... \n HW2 自評分數: \n 完成上述流程後, 請將 HW2 自評分數輸入 cad2024 自評表單中. \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW2_Exam', 'text': '與 HW2 內容相近的組立件題目, 隨堂進行考試. \n 零件與組立件考試題目以 Solvespace 繪圖操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的零件與組立件檔案下載 \n 零件與組立件考試題目以 NX 繪圖操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的零件與組立件檔案下載 \n', 'tags': '', 'url': 'HW2_Exam.html'}, {'title': 'HW3', 'text': 'Homework 3 (20%): \n 建立  Balance on Wheels  控制系統設計模擬場景 \n https://github.com/mdecycu/Balance_On_Wheels \n \n \n Balance_on_wheels_nx2312.7z \n Balance_on_Wheel_scene.7z \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'HW3_Exam', 'text': '與 HW3 內容相近的模擬場景題目, 隨堂進行考試. \n 建立模擬場景操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的模擬場景與控制程式檔案下載 \n \n 利用 CoppeliaSim 建立  Balance on Wheels  控制系統設計模擬場景的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業三 \n 請將操作影片嵌入 ...... \n 所完成的場景與控制程式檔案下載 \n HW3 執行心得: \n ...... \n HW3 自評分數: \n 完成上述流程後, 請將 HW3 自評分數輸入 cad2024 自評表單中. \n', 'tags': '', 'url': 'HW3_Exam.html'}, {'title': 'HW4', 'text': 'Homework 4 (20%): \n 建立  Dingo 機器狗 控制系統設計模擬場景 \n https://github.com/mdecycu/DingoQuadruped \n DINGO_QUADRUPED_CAD.7z \n \n \n 利用 CoppeliaSim 建立  Dingo 機器狗 控制系統設計模擬場景的操作過程與說明影片如下: \n 影片標題: 國立虎尾科技大學機械設計工程系電腦輔助設計與實習- 作業四 \n 所完成的場景與控制程式檔案下載 \n HW4 執行心得: \n .... \n HW4 自評分數: \n 完成上述流程後, 請將 HW4 自評分數輸入 cad2024 自評表單中. \n', 'tags': '', 'url': 'HW4.html'}, {'title': 'HW4_Exam', 'text': '與 HW4 內容相近的模擬場景題目, 隨堂進行考試. \n 建立模擬場景操作過程影片如下: \n 請將操作影片嵌入 ...... \n 所完成的模擬場景與控制程式檔案下載 \n', 'tags': '', 'url': 'HW4_Exam.html'}, {'title': 'practise', 'text': '', 'tags': '', 'url': 'practise.html'}, {'title': 'browsing', 'text': '', 'tags': '', 'url': 'browsing.html'}, {'title': 'Combined', 'text': 'w11，小組繪製組合零件檔案，個人部分，零件繪製過程影片： \n Piece composite_sldprt ：\xa0 .slvs  /  .prt \n \n Plastique Flipper_sldprt ：  .slvs  /  .prt\xa0 \n \n Support Bobine_sldprt ：\xa0 .slvs \xa0 /  .prt \n \n Flipper_sldprt ：\xa0 .slvs \xa0 /  .prt \n \n Plongeur Batteur_sldprt ：\xa0 .slvs \xa0 /  .prt \n \n \n \n \n', 'tags': '', 'url': 'Combined.html'}, {'title': 'other', 'text': '配合課堂要求網站標題名稱及內容將 w7、w10、w11 ，課程整理移動至此。 \n w7： \n 1. solvespace配合ZoomIt64和sharex錄製繪圖過程， ZoomIt64可以在使用sharex錄製影片時點擊ctrl+1框選影片的重點。 \n \n 2. NX使用(開啟前的設定已 w3 周分頁面中) \n 3. 使用hybrid利用本機的固態硬碟開啟NX \n 此目的是為了解決使用USB開啟NX速度的問題，因為學校電腦原本就附有NX檔案，所以使用主機端硬碟來開啟NX就能解決開啟緩慢問題，這個方法的條件是所需的電腦端有NX檔案的前提下，如果電腦端內無NX檔案，還是使用USB內下載過的9G NX做開啟，如是使用固態硬碟的話，則不需要再額外去使用本機開啟NX。 \n 在hybrid檔案內有兩個檔案，一個 下載所需的可攜程式 ，另一個則在可攜程式下載完畢後點擊開啟，就能 以本機硬碟開啟NX 。 \n 本周練習進度： \n https://mdecad2024.github.io/hw-zhe41223118/cmsimde/static/viewstl.html?src=https://s104.cycu.org/~41223118/41223118_part4.stl \n \n \n Model Color:  Back Color1:  Back Color2:  Render Mode: \n Flat \n Point \n Wireframe \n Smooth \n Definition: \n Standard \n low \n high \n \n \n solvespace： 41223118_part4 \n', 'tags': '', 'url': 'other.html'}, {'title': 'Final Report', 'text': '期末口頭與書面專題報告 (30%) \n 期末口頭專題報告影片: \n ...... \n 期末書面專題報告檔案 (pdf): \n ...... \n 電腦輔助設計與實習課程總結心得: \n ...... \n 期末報告自評成績: \n 完成上述流程後, 請將 Final Report 自評分數輸入 cad2024 自評表單中.', 'tags': '', 'url': 'Final Report.html'}]};